apiEndpoint.description:
Returns events in which player played or was on the bench. In addition to events, multiple maps are returned where keys
are event ids and values can be:
 - `playedForTeamMap`: player's team id in the event (eventId -> teamId)
```
         {
             "8285996" : 3002,
             "8559883" : 3002,
                 .
                 .
                 .
         }
```
 - `statisticsMap`: player's statistics, rating for example (eventId -> statistics)
```
         {
             "8285996" : {
                 "rating": 6.5
             },
             "8559883" : {
                 "rating": 7.3
             },
                 .
                 .
                 .
         }
```
 - `incidentsMap`: number of goals, own goals, assists and cards (eventId -> incidentsStats)
```
        {
             "8285996" : {
                 "assists": 1,
                 "yellowCards": 1
             },
             "8559883" : {
                 "goals": 1
                 "penaltyGoals": 1
             },
             "8391610" : {
                 "goals": 1
                 "penaltyGoals": 1
             },
                 .
                 .
                 .
         }
```
 - `onBenchMap`: true if player stayed on the bench (eventId -> bool)
```
         {
             "8285996" : true
         }
```

Parameter span indicates whether future start dates are wanted or past start dates.

An example: `136710`


